import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HtmlTutorialComponent } from './components/html-tutorial/html-tutorial.component';
import { HcssTutorialComponent } from './components/hcss-tutorial/hcss-tutorial.component';
import { CssTutorialComponent } from './components/css-tutorial/css-tutorial.component';

@NgModule({
  declarations: [
    AppComponent,
    HtmlTutorialComponent,
    HcssTutorialComponent,
    CssTutorialComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
